import styles from "./header.module.css";
import clsx from "clsx";
import { Link } from "react-router-dom";
// import {FontAwesomeIcons} from react-icons;

import logo from "../../assets/images/logo1.png" ;
export default function Header() {
  return (
    
     <div className={styles.header_container}>
      <div className={styles.logo_container}>
      <Link className={styles.link} to="/"><img src={logo}alt="" /></Link>
            
           <Link className={styles.link} to="/"><div style={{fontSize:'40px'}}>ARTY</div></Link>
        </div>   
           <Link className={styles.link} to="/"><div>Trang chủ</div></Link>
           <Link className={styles.link} to="/ticket_buy"><div>Mua vé</div></Link>
           <Link className={styles.link} to="/watch"><div>Xem online</div></Link>
            <div id={styles.log }>
               <div id={styles.login}>Đăng nhập</div>
                <div id={styles.signup}>Đăng ký</div> 
            </div> 
            
     </div>

    
  );
}
